function useStats(){
    const [stats, setStats] = useState();
    useEffect(()=> {
        console.log("Fetching Data")
        async function fetchData(){
            const data = await fetch('https://covid19.mathdro.id/api').then(data => 
                data.json()
            );
            setStats(data);
        }
        fetchData();
    }, []);
}

function Stats(){

    const stats = useStats();
    console.log(stats)
    return <div>
        <p>Stats:</p>
    </div>
}

